def minMax(s, tree, X):
   if X:
      v = maxV(s, tree)
   else:
      v = minV(s, tree)
   return v
   
def maxV(s, tree):
   d = done(s)
   #print(s, 'max')
   if not d == None:
      #print('d', d)
      tree[s] = d
      return d
   v = float('-inf')
   #print('orig', v)
   for c in child(s, True):
      recur = minV(c, tree)
      #print(recur)
      v = max(v, recur)
   tree[s] = v
   return v
   
def minV(s, tree):
   d = done(s)
   #print(s, 'min')
   if not d == None:
      #print('d', d)
      tree[s] = d
      return d
   v = float('inf')
   for c in child(s, False):
      recur = maxV(c, tree)
      #print('---', recur)
      v = min(v, recur)
   tree[s] = v
   return v

