def done(s):
   xi = set()
   oi = set()
   for i in range(len(s)):
      v = s[i]
      if v == 'X':
         xi.add(i)
      if v == 'O':
         oi.add(i)
   #print(xi)
   #print(oi)
   for end in [[0,1,2],[0,4,8],[0,3,6],[1,4,7],[2,5,8],[2,4,6],[3,4,5],[6,7,8]]:        
      if end[0] in xi and end[1] in xi and end[2] in xi:
         #print('xx', s)
         return 1
      if end[0] in oi and end[1] in oi and end[2] in oi:
         #print('oo', s)
         return -1
   if not '.' in s:
         #print(s)
         return 0
   return None
      
def child(s, x):
   if x:
      v = 'X'
   else:
      v = 'O'
   children = set()
   #print('+++', s)
   for c in range(9):
      if s[c] == '.':
         #print(s[:c]+v+s[c+1:])
         children.add(s[:c]+v+s[c+1:])
   #print(children)
   return children

def pB(s):
   for i in range(3):
      print(s[i*3], ' ', s[i*3 + 1], ' ', s[i*3 + 2], '\n')

def turns(s, XX, tree):
   while done(s) == None:
      pB(s)
      if XX == True:
         print("X's turn: ")
         print()
         if len(s.strip('.')) < 1:
            s = s[:4] + 'X' + s[5:]
         else:
            s = max(child(s, True), key = lambda x: tree[x])
         #print(s, done(s))
      else:
         print("O's turn: ")
         choices = [x for x in range(9) if s[x] == '.']
         for a in range(len(choices)):
            ii = choices[a]%3
            jj = choices[a]//3
            print(a, '  ', (ii,jj))
         aa = int(input('Next Move? (across, down) '))
         print()
         while aa not in range(len(choices)):
            print('Invalid Choice, please try again.')
            aa = int(input('Next Move? '))
         s = s[:choices[aa]] + 'O' + s[choices[aa]+1:]
      XX = not XX
   pB(s)
   return done(s)
      
      
